import React from 'react'
import { Col, Row } from 'react-bootstrap';
import Container from 'react-bootstrap';

function Cust_reg() {
    return (
      <div style={{marginTop:"8vh"}}>
       
       <Container>
          <form>
      <label>
        Name:
        <input type="text" name="name" />
      </label>
    
    </form>
    </Container>
       
    
        
        
      </div>
    );
  }
  
  export default Cust_reg;
